export default {
  path: '/',
  redirect: '/shopManage',
  component: () => import('@/layouts/index.vue'),
  children: [{
    path: '/shopManage',
    name: '商品管理',
    template: '<router-view></router-view>',
    children: [{
      path: '/addGoods',
      name: '增加商品',
      component: () => import( /* webpackChunkName: "module-shopManage" */ '@/components/shopList/addGoods.vue'),
    }, {
      path: '/需求池管理',
      name: '增加商品',
      component: () => import( /* webpackChunkName: "module-shopManage" */ '@/components/shopList/demandsManage.vue'),
    }, {
      path: '/需求单列表',
      name: '增加商品',
      component: () => import( /* webpackChunkName: "module-shopManage" */ '@/components/shopList/demandsLists.vue'),
    }]
  }, {
    path: '/popularize',
    name: '店铺推广',
    template: '<router-view></router-view>',
    children: [{
      path: '/survey',
      name: '推广概括',
      component: () => import( /* webpackChunkName: "module-popularize" */ '@/components/popularize/survey.vue'),
    }, {
      path: '/HelloWorld',
      name: 'hello',
      component: () => import( /* webpackChunkName: "module-popularize" */ '@/components/popularize/HelloWorld.vue'),
    }]
  }],
};
